import React from 'react';
import {Heading} from "@chakra-ui/react";
import {useParams} from "react-router-dom";

const GradeQuiz = () => {

    //get id in params
    const {id} = useParams();

    return (
        <div>
            <Heading>Grade Quiz Page</Heading>
            <Heading>{id}</Heading>
        </div>
    );
};

export default GradeQuiz;
